    //   // this.state={
    //   //   username: ""
    //   // }
    // }
    render(){
      return (
        <div className = "gridWrap">
        <Container>
          <Row> <h4>Row</h4>
            <Col>        
              <Card>
              <Card.Img src = {Vsc}fluid> 
              </Card.Img> 
              </Card>
            </Col>      
            <Col>        
              <Card>
              <Card.Img src = {Html}fluid> 
              </Card.Img> 
              </Card>
            </Col> 
            <Col>        
              <Card>
              <Card.Img src = {Es6}fluid> 
              </Card.Img> 
              </Card>
            </Col>      
          </Row>
          <Row> <h4>Row</h4>
            <Col>        
              <Card>
              <Card.Img src = {Vsc}fluid> 
              </Card.Img> 
              </Card>
            </Col>      
            <Col>        
              <Card>
              <Card.Img src = {Html}fluid> 
              </Card.Img> 
              </Card>
            </Col> 
            <Col>        
              <Card>
              <Card.Img src = {Es6}fluid> 
              </Card.Img> 
              </Card>
            </Col>      
          </Row>
        </Container>
        </div>
      )
    } 
}
    
  export default Gri;
